TextsFaq:
  TextsFaq_1:
    texts_faq_question: 'Can I use tracks available on Smashintracks.com in my sets?'
    texts_faq_answer: '<p>You are copyrighted to use tracks bought by yourself in mixtapes, radio shows, play in clubs by all means.</p>'
    texts_faq_order: '2'
  TextsFaq_3:
    texts_faq_question: 'Is it possible to take back purchased tracks?'
    texts_faq_answer: '<p>No, there is no opportunity to take back purchased tracks.</p>'
    texts_faq_order: '3'
  TextsFaq_10:
    texts_faq_question: 'What is the opportunity to buy or sell tracks in wave files?'
    texts_faq_answer: '<p>There is none. Smashintracks.com allows to buy and sell tracks in mp3 high quality 320 kbps files.</p>'
    texts_faq_order: '4'
  TextsFaq_11:
    texts_faq_question: 'I am a producer and I would like to sell my tracks on Smashintracks.com, what do I have to do?'
    texts_faq_answer: '<p>You have to only register and upload your tracks using user panel instructions. Tracks will be available within 24 hours.</p>'
    texts_faq_order: '5'
  TextsFaq_12:
    texts_faq_question: 'I am owner of a label and I would like to distribute our tracks with Smashintracks.com - what do I have to do?'
    texts_faq_answer: '<p>You have to only register and upload your tracks using user panel instructions. Tracks will be available within 24 hours.</p>'
    texts_faq_order: '6'
  TextsFaq_13:
    texts_faq_question: 'Im making music in genre that is not listed in Smashintracks.com, is there any chance to add a new genre?'
    texts_faq_answer: '<p>Of course, only thing you have to do is to send us email with music genre proposal and add links to your music in order to make it easier for us.</p>'
    texts_faq_order: '7'
  TextsFaq_14:
    texts_faq_question: 'What is the purpose of 10 recommended tracks box on Smashintracks.com?'
    texts_faq_answer: '<p>You can find here a list with the latest one week selection uploaded by Smashintracks artists. Recommendation is done by Smashintracks.com staff.</p>'
    texts_faq_order: '8'
  TextsFaq_15:
    texts_faq_question: 'Can I pay for my purchases using credit card?'
    texts_faq_answer: '<p>Payments on Smashintracks.com are made ONLY by Paypal system.</p>'
    texts_faq_order: '9'
  TextsFaq_16:
    texts_faq_question: 'I would like to withdraw money earned here on Smashintracks.com - what do I have to do?'
    texts_faq_answer: '<p>You have to click WITHDRAW MONEY button in your user panel. Money will be sent to your paypal account within 2 - 3 working days.</p>'
    texts_faq_order: '10'
  TextsFaq_17:
    texts_faq_question: 'I called for money withdraw earned on Smashintracks.com, 3 days has passed by and still don''t have them in my Paypal account, what is happening?'
    texts_faq_answer: '<p>Please check your paypal address you have put during registration process. Smashintracks.com sends money to paypal address added in registration process. If addresses differs from each other, pleases send us an email with correct Paypal address, Smashintracks.com will send you money once again.</p>'
    texts_faq_order: '11'
Texts:
  Texts_1:
    texts_name: Home-niezalogowany-welcome-text
    texts_value: "<p><span style=\"font-size: x-large;\"><strong><span style=\"color: #04bae1;\">SmashinTracks.com</span> is the best place</strong><strong>&nbsp; </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-large;\"><strong>where you may buy and sell your own </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-large;\"><strong>music, exclusive remixes and </strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: x-large;\"><strong>up</strong> <strong>to date unreleased tracks.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\">Buying process runs with few clicks, payments are integrated</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\">with <strong><a href=\"https://www.paypal.com/\" target=\"_blank\">Paypal</a></strong> system. All tracks available on <strong>SmashinTracks.com</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\"> service are <strong><span style=\"color: #04bae1;\">320 kbps</span></strong></span> <span style=\"font-size: medium;\">only.</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"font-size: medium;\">You only have to register in order to sell your tracks!</span></strong></p>\r\n<p><span style=\"font-size: medium;\"><br /></span></p>\r\n<p><span style=\"font-size: large;\"><strong>Step 1: REGISTER</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: large;\"><strong>Step 2: UPLOAD</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: large;\"><strong><span style=\"font-size: large;\"><strong>Step 3: SELL</strong></span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: large;\"><span style=\"font-size: medium;\">Check our Recommends tracks, Charts, Artist and more.</span><strong><br /></strong></span></p>"
    texts_help: ''
  Texts_2:
    texts_name: Home-niezalogowany-recommends-10-smashin-trac
    texts_value: '<p>Here''s a hand picked selection of <span class="blue">smashing tracks</span> personally recommended by <a class="underline" href="#">Smashintracks.com</a> in this week.</p>'
    texts_help: ''
  Texts_3:
    texts_name: Home-niezalogowany-new-tracks
    texts_value: "<p>Here are the latest <span class=\"blue\">10 tunes</span> on <a href=\"#\" class=\"underline\">Smashintracks.com</a><br />\r\n                        Click the button 'FULL LIST' if you want see list of new tracks from latest months.</p>"
    texts_help: ''
  Texts_4:
    texts_name: Home-niezalogowany-bestsellers-tracks
    texts_value: "<p>Here are <span class=\"blue\">10 most popular tracks</span> on <a href=\"#\" class=\"underline\">Smashintracks.com</a> from latest week.<br />\r\n                        Click the button 'FULL LIST' if you want see lists of new more charts.</p>"
    texts_help: ''
  Texts_5:
    texts_name: Charts-This-Week-main-text
    texts_value: '<p>Here are the list with <span class="blue">30 bestsellers in this week </span>on <a class="underline" href="#">Smashintracks.com</a><br /> See also other ''CHARTS''.</p>'
    texts_help: ''
  Texts_6:
    texts_name: FAQ-main-text
    texts_value: '<p>Answers for all pervaded questions regarding <a class="underline" href="#">Smashintracks.com</a> operation.</p>'
    texts_help: ''
  Texts_7:
    texts_name: Genre-list-main-text
    texts_value: '                        Here are the latest <span class="blue">__GENRESNAME__ </span> tracks that have been uploaded through producers on <a href="#" class="underline">Smashintracks.com</a> Check this out!'
    texts_help: '__GENRESNAME__ - nazwa gatunku'
  Texts_8:
    texts_name: New-tracks-main-text
    texts_value: "<p>Here are the latest <span class=\"blue\">tunes</span> on <a href=\"#\" class=\"underline\">Smashintracks.com</a> that have been uploaded <br />\r\n                        through producers FROM all genres. Check this out!</p>"
    texts_help: ''
  Texts_9:
    texts_name: Terms-main-text
    texts_value: "<p><strong>To use <a class=\"underline\" href=\"#\">Smashintracks.com</a> you must agree to the following terms and conditions:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Artist must upload their only copyright material for which they do have permission to use and distribute.</p>\r\n<p>&nbsp;</p>\r\n<p>If an artist uploads any copyright protected material they will be banned and the profile will be removed from Smashitracks.com, uploaded therefore material will be definitely removed from the Smashintracks.com service.</p>"
    texts_help: ''
  Texts_10:
    texts_name: Search-main-text
    texts_value: '<p>Here''s a hand picked selection of smashing tracks personally recommended by <a href="#" class="underline">Smashintracks.com</a> in this week.</p>'
    texts_help: '__KEYWORD__ - szukane s≈Çowo'
  Texts_11:
    texts_name: Search-No-Results
    texts_value: "<p>Sorry, we couldn't find any tracks matching <strong>__KEYWORD__</strong></p>\r\n<p>Try again please.<strong><br /></strong></p>"
    texts_help: '__KEYWORD__ - szukane s≈Çowo'
  Texts_12:
    texts_name: Artists-30-most-popular-main-text
    texts_value: '<p>There is full listing of <span class="blue">30 top artists </span>on <a class="underline" href="#">Smashintracks.com</a>. Check this out!</p>'
    texts_help: ''
  Texts_13:
    texts_name: Koszyk-main-text
    texts_value: "<p>You will receive <span class=\"blue\">unique download links to your purchases</span> after you make payments. You may download <span class=\"blue\">max 3 times</span> each track. Links will work for <span class=\"blue\">7 days</span> after payment.</p>\r\n<p><span class=\"blue\"><br /></span></p>"
    texts_help: ''
  Texts_14:
    texts_name: Koszyk-Order-Complete-main-text
    texts_value: '<p>You have used <a class="underline" href="#">Paypal.com</a><br /> payment for your purchase. Transactions details below&hellip;...</p>'
    texts_help: ''
  Texts_15:
    texts_name: Koszyk-download-main-text
    texts_value: '<p>Below you see tracks which you have bought ready to download. You can download them 3 times, links to them will work 7 days.</p>'
    texts_help: ''
  Texts_16:
    texts_name: ZALOGOWANY-Home-welcome-text
    texts_value: '<p>Welcome in <a class="underline" href="#">Smashintracks.com</a> users panel...</p>'
