  Texts_33:
    texts_name: Zmiana-hasla-main-text
    texts_value: '<p>Please select a clever new password below.</p>'
    texts_help: ''
  Texts_34:
    texts_name: Kontakt-main-text
    texts_value: '<p>If you wish to contact us, use form below. If you have any problems with your purchased tracks do not forget to enter <span class="blue">your order code.</span></p>'
    texts_help: ''
  Texts_35:
    texts_name: Kontakt-message-send
    texts_value: '<p>Your message has been send.</p>'
    texts_help: ''
  Texts_36:
    texts_name: ZALOGOWANY-Wyplata-pieniedzy-zgloszenie-wysla
    texts_value: "<p><strong>Your withdraw aplication has been <span class=\"blue\">sent successfully</span>. Your money will be sent to your Paypal account within <span class=\"blue\">2-3 working days</span>.</strong></p>\r\n<p><strong><br /></strong></p>"
    texts_help: ''
  Texts_37:
    texts_name: ZALOGOWANY-Wyplata-pieniedzy-main-text
    texts_value: "<div class=\"bw-div1\">Your current balance available to spend or withdraw is...</div>\r\n<div id=\"bw3-div1\">Your balance: <strong>__BALANCE__</strong></div>\r\n<div id=\"bw3-div2\">If you would like your money paying to you via <span class=\"blue\">PayPal</span> you will need a minimum ballance of <span class=\"blue\">&pound;10.00</span> first.</div>"
    texts_help: '__BALANCE__ - stan konta'
  Texts_38:
    texts_name: ZALOGOWANY-Wyplata-pieniedzy-spend-it-on
    texts_value: "<p>You can spend what you have earned instantly on <a href=\"#\" class=\"underline\">Smashintracks.com</a><br /><br />\r\n\r\n                        When goto the checkout click <span class=\"blue\">Pay with money earned on <a href=\"#\" class=\"underline\">Smashintracks.com</a></span><br />\r\n                        and what you spend on tunes will be deducted from your earnings.</p>"
    texts_help: ''
  Texts_39:
    texts_name: ZALOGOWANY-Wyplata-pieniedzy-your-paypal
    texts_value: '<p>Click the link bellow and we will send you your earnings on <span class="blue">your PayPal</span> account.</p>'
    texts_help: ''
  Texts_40:
    texts_name: ZALOGOWANY-Wyplata-pieniedzy-sorry
    texts_value: '<p>Sorry but the minimum withrawal limit is <strong><strong>&pound;</strong>10.</strong></p>'
    texts_help: ''
  Texts_41:
    texts_name: ZALOGOWANY-Upload-Track-main-text
    texts_value: '<p>You can upload your tracks here. Limit is <span class="blue">__LIMIT__ </span>tracks per day. Track will be accepted within <span class="blue">24 hours after upload</span> and will be added to the shopping list. Have fun.</p>'
    texts_help: '__LIMIT__ - limit'
  Texts_42:
    texts_name: ZALOGOWANY-Upload-Track-sukces
    texts_value: "<p><strong><span class=\"blue\">Your track has been uploaded successfully.</span></strong></p>\r\n<p>Track will be accepted within 24 hours after upload and will be added to the shopping list. Click <strong>OK</strong> button to close the window.</p>"
    texts_help: ''
  Texts_43:
    texts_name: ZALOGOWANY-Upload-Track-limit
    texts_value: '<p><strong>Unfortunately, you have used your daily upload limit <span class="blue">(__LIMIT__ per day)</span>.&nbsp; Welcome back later.</strong></p>'
    texts_help: '__LIMIT__ - limit'
  Texts_44:
    texts_name: ZALOGOWANY-My-Tracks-All
    texts_value: '<p>You can check how often your tracks are previewed, bought and added to others ''Wishlists'' in this section.</p>'
    texts_help: ''
  Texts_45:
    texts_name: ZALOGOWANY-My-Tracks-Most-Popular
    texts_value: '<p>You can check how often your tracks are previewed, bought and added to others ''Wishlists'' in this section.</p>'
    texts_help: ''
  Texts_46:
    texts_name: ZALOGOWANY-My-Tracks-in-wishlists
    texts_value: '<p>You can check how often your tracks are previewed, bought and added to others ''Wishlists'' in this section.</p>'
    texts_help: ''
  Texts_47:
    texts_name: ZALOGOWANY-My-downloads-main-text
    texts_value: '<p>History of your purchases is here. If you have purchased tracks in last 7 days, you will find links to download them.</p>'
    texts_help: ''
  Texts_48:
    texts_name: ZALOGOWANY-My-Wishlist-last-added
    texts_value: '<p>You may check your wishlist here. You can keep tracks you wish to buy in future in your profile etc.</p>'
    texts_help: ''
  Texts_49:
    texts_name: ZALOGOWANY-My-Wishlist-by-artist
    texts_value: '<p>You may check your wishlist here. You can keep tracks you wish to buy in future in your profile etc.</p>'
    texts_help: ''
  Texts_50:
    texts_name: ZALOGOWANY-My-Profile-main-text
    texts_value: '<p>If you are selling your tracks on SmashinTracks.com it is worth to update your profile on information about yourself, your photos and logos. They will be visible for all your profile visitors.</p>'
    texts_help: ''
  Texts_51:
    texts_name: ZALOGOWANY-My-Profile-main-settings
    texts_value: "<p>You can change here your basic data such as artist name, e-mail, password.</p>\r\n<p><span class=\"blue\"><br /></span></p>"
    texts_help: ''
  Texts_52:
    texts_name: Register-welcome-text
    texts_value: "<div id=\"bw2-div1\">\r\n<p><strong>Congratulations on successful Smashintracks.com registration!</strong></p>\r\n<br />\r\n<p><strong>From now on you will rejoice full functionality of this service, inter alia:</strong></p>\r\n<br /><strong> <span class=\"blue\"> - Uploading and selling your own tracks,<br /><br /> - Buying other tracks with earned money on Smashintracks.com,<br /><br /> - Your own tracks popularity stats managing<br /><br /> &nbsp; and much more.</span></strong></div>\r\n<div><strong><span class=\"blue\"><br /></span></strong></div>\r\n<div id=\"bw2-div2\">\r\n<p><strong>Go to your profile HOMEPAGE to find out your administration panel. Do not forget to update your Profile with photo, informations on your music activity, promo urls etc.</strong></p>\r\n</div>"
    texts_help: ''
  Texts_53:
    texts_name: Register-confirm-text
    texts_value: "<div id=\"bw2-div1\">\r\n<p><strong>Congratulations on successful Smashintracks.com registration!</strong></p>\r\n<br />\r\n<p><strong>You will receive email with confirmation link. </strong></p>\r\n</div>\r\n<div><strong><span class=\"blue\"><br /></span></strong></div>"
    texts_help: ''
